import React from 'react';
import './App.scss';
import Board from './components/Board';
import { Grid } from '@material-ui/core';

function App() {
  return (
    <div className="App">
      <Grid container>
        <Grid item xs={12}>
          <Grid container justify="center">
            <Grid item>
              <Board></Board>
            </Grid>
          </Grid>
        </Grid>
      </Grid>
    </div>
  );
}

export default App;
